import React from "react";
import Label from "./components/base/Label";
import Frame from "./components/base/Frame";
import Card from "./components/base/Card";


import Header from "./components/structure/Header";
import Banner from "./components/base/Banner.jsx";
import Outline from "./components/base/Outline";



function App() {
  return (
    <div className="h-full w-full bg-[#E5E5E5] ">
      <Header />
      <Label />
      <Banner />
      <Frame />
      <Outline/>
      <Card/>
    </div>
  );
}

export default App;
